;; **
;;; Extensive use of `+` is made in ggplot2 for combining layers. A helper function `gg4clj/r+` takes care of this.
;;; 
;;; (There's no magic here. It can be done manually using `[:+ ...]` too, but note that in R the prefix `+` operator is at most arity 2. The helper function is much more convenient!)
;;; 
;;; This example shows a more complex ggplot call, using `+`. It also demonstrates passing options to the view function to control the output. 
;; **

;; @@
(gg4clj/view (gg4clj/r+
               [:ggplot :diamonds [:aes :depth]]
               [:xlim 58 68]
               [:geom_histogram [:aes {:fill :cut}] {:binwidth 0.5 :position "fill"}]
               [:theme_bw])
             {:width 8.5 :height 4})
