;; @@
(defn b-m
  []
  (let [a (rand)
        b (rand)
        r (Math/sqrt (* -2 (Math/log a)))
        th (* 2 Math/PI b)]
    (* r (Math/cos th))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gg4clj.demo/b-m</span>","value":"#'gg4clj.demo/b-m"}
