;; @@
(def g-dat {:g1 (repeatedly 50 b-m) :g2 (repeatedly 50 b-m)})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gg4clj.demo/g-dat</span>","value":"#'gg4clj.demo/g-dat"}
;; <=

;; @@
(gg4clj/view [[:<- :g (gg4clj/data-frame g-dat)]
              (gg4clj/r+
                [:ggplot :g [:aes :g1 :g2]]
                [:guides {:fill :F}]
                [:xlim -2 2]
                [:ylim -2 2]
                [:geom_point {:colour "steelblue" :size 4}]
                [:stat_density2d {:colour "#FF29D2"}]
                [:theme_bw])]
             {:width 5 :height 5})
